import { use, expect } from 'chai';
import { readFileSync } from 'fs';
import { loadMsh, loadMshAsync, parseMsh } from '../src/msh-parser';
import chaiAlmost from 'chai-almost';
use(chaiAlmost(0.1));

const stanfordBunny = readFileSync('./test/msh/stanford_bunny.msh');
const wingnut = readFileSync('./test/msh/wingnut.msh');

describe('mesh-parser', () => {
	describe('loadMsh', () => {
		it('loads stanford_bunny.msh', () => {
			loadMsh('./test/msh/stanford_bunny.msh', (mesh) => {
				const {
					nodes,
					elements,
					isTetMesh,
					exteriorFaces,
					numExteriorNodes,
				} = mesh;
				expect(nodes.constructor).to.equal(Float64Array);
				expect(nodes.length).to.equal(25476);
				expect(elements.length).to.equal(27232);
				expect(elements[0].length).to.equal(4);
				expect(isTetMesh).to.equal(true);
				expect(exteriorFaces!.length).to.equal(14024);
				for (let i = 0; i < exteriorFaces!.length; i++) {
					for (let j = 0; j < exteriorFaces![i].length; j++) {
						expect(exteriorFaces![i][j]).to.be.lessThan(numExteriorNodes!);
					}
				}
				expect(numExteriorNodes).to.equal(7014);
			});
		});
		it('loads wingnut.msh', () => {
			loadMsh('./test/msh/wingnut.msh', (mesh) => {
				const {
					nodes,
					elements,
					isTetMesh,
					exteriorFaces,
					numExteriorNodes,
				} = mesh;
				expect(nodes.constructor).to.equal(Float64Array);
				expect(nodes.length).to.equal(15573);
				expect(elements.length).to.equal(16753);
				expect(elements[0].length).to.equal(4);
				expect(isTetMesh).to.equal(true);
				expect(exteriorFaces!.length).to.equal(8746);
				for (let i = 0; i < exteriorFaces!.length; i++) {
					for (let j = 0; j < exteriorFaces![i].length; j++) {
						expect(exteriorFaces![i][j]).to.be.lessThan(numExteriorNodes!);
					}
				}
				expect(numExteriorNodes).to.equal(4373);
			});
		});
	});
	describe('loadMshAsync', () => {
		it('loads stanford_bunny.msh', async () => {
			const mesh = await loadMshAsync('./test/msh/stanford_bunny.msh');
			const {
				nodes,
				elements,
				isTetMesh,
				exteriorFaces,
				numExteriorNodes,
			} = mesh;
			expect(nodes.constructor).to.equal(Float64Array);
			expect(nodes.length).to.equal(25476);
			expect(elements.length).to.equal(27232);
			expect(elements[0].length).to.equal(4);
			expect(isTetMesh).to.equal(true);
			expect(exteriorFaces!.length).to.equal(14024);
			for (let i = 0; i < exteriorFaces!.length; i++) {
				for (let j = 0; j < exteriorFaces![i].length; j++) {
					expect(exteriorFaces![i][j]).to.be.lessThan(numExteriorNodes!);
				}
			}
			expect(numExteriorNodes).to.equal(7014);
		});
		it('loads wingnut.msh', async () => {
			const mesh = await loadMshAsync('./test/msh/wingnut.msh');
			const {
				nodes,
				elements,
				isTetMesh,
				exteriorFaces,
				numExteriorNodes,
			} = mesh;
			expect(nodes.constructor).to.equal(Float64Array);
			expect(nodes.length).to.equal(15573);
			expect(elements.length).to.equal(16753);
			expect(elements[0].length).to.equal(4);
			expect(isTetMesh).to.equal(true);
			expect(exteriorFaces!.length).to.equal(8746);
			for (let i = 0; i < exteriorFaces!.length; i++) {
				for (let j = 0; j < exteriorFaces![i].length; j++) {
					expect(exteriorFaces![i][j]).to.be.lessThan(numExteriorNodes!);
				}
			}
			expect(numExteriorNodes).to.equal(4373);
		});
	});
	describe('parseMsh', () => {
		it('parses stanford_bunny.msh', () => {
			const mesh = parseMsh(stanfordBunny);
			const {
				nodes,
				elements,
				isTetMesh,
				exteriorFaces,
				numExteriorNodes,
			} = mesh;
			expect(nodes.constructor).to.equal(Float64Array);
			expect(nodes.length).to.equal(25476);
			expect(elements.length).to.equal(27232);
			expect(elements[0].length).to.equal(4);
			expect(isTetMesh).to.equal(true);
			expect(exteriorFaces!.length).to.equal(14024);
			for (let i = 0; i < exteriorFaces!.length; i++) {
				for (let j = 0; j < exteriorFaces![i].length; j++) {
					expect(exteriorFaces![i][j]).to.be.lessThan(numExteriorNodes!);
				}
			}
			expect(numExteriorNodes).to.equal(7014);
		});
		it('parses wingnut.msh', () => {
			const mesh = parseMsh(wingnut);
			const {
				nodes,
				elements,
				isTetMesh,
				exteriorFaces,
				numExteriorNodes,
			} = mesh;
			expect(nodes.constructor).to.equal(Float64Array);
			expect(nodes.length).to.equal(15573);
			expect(elements.length).to.equal(16753);
			expect(elements[0].length).to.equal(4);
			expect(isTetMesh).to.equal(true);
			expect(exteriorFaces!.length).to.equal(8746);
			for (let i = 0; i < exteriorFaces!.length; i++) {
				for (let j = 0; j < exteriorFaces![i].length; j++) {
					expect(exteriorFaces![i][j]).to.be.lessThan(numExteriorNodes!);
				}
			}
			expect(numExteriorNodes).to.equal(4373);
		});
	});
	describe('helper functions', () => {
		it('calculates edges', () => {
			expect(parseMsh(stanfordBunny).edges.length).to.equal(85470);
			expect(parseMsh(wingnut).edges.length).to.equal(52634);
			// // Should only work for tet meshes.
			// // @ts-ignore
			// assert.throws(() => { MSHParser.calculateEdges({}); },
			// 		'MSHParser.calculateEdges() is not defined for non-tet meshes.');
		});
		it('calculates exterior edges', () => {
			{
				const mesh = parseMsh(stanfordBunny);
				const { numExteriorNodes, exteriorEdges } = mesh;
				expect(exteriorEdges.length).to.equal(42072);
				for (let i = 0; i < exteriorEdges.length; i++) {
					expect(exteriorEdges[i]).to.be.lessThan(numExteriorNodes!);
				}
			}
			{
				const mesh = parseMsh(wingnut);
				const { numExteriorNodes, exteriorEdges } = mesh;
				expect(exteriorEdges.length).to.equal(26238);
				for (let i = 0; i < exteriorEdges.length; i++) {
					expect(exteriorEdges[i]).to.be.lessThan(numExteriorNodes!);
				}
			}
			// // Should only work for tet meshes.
			// // @ts-ignore
			// assert.throws(() => { MSHParser.calculateExteriorEdges({}); },
			// 		'MSHParser.calculateExteriorEdges() is not defined for non-tet meshes.');
		});
		it('calculates element volumes', () => {
			const mesh = parseMsh(stanfordBunny);
			const { elementVolumes } = mesh;
			const results = [
				0.8946202993392944,
				0.40149927139282227,
				0.47812920808792114,
				0.8394981026649475,
				129.67111206054688,
				0.48769786953926086,
				0.8108745217323303,
				545.7216796875,
				289.6062927246094,
				113.19168090820312
			];
			for (let i = 0; i < results.length; i++) {
				expect(elementVolumes[i]).to.equal(results[i]);
			}

			// // Should only work for tet meshes.
			// // @ts-ignore
			// assert.throws(() => { MSHParser.calculateElementVolumes({}); },
			// 		'MSHParser.calculateElementVolumes() is not defined for non-tet meshes.');
		});
		it('calculates nodal volumes', () => {
			const mesh = parseMsh(stanfordBunny);
			const { elementVolumes, nodalVolumes } = mesh;
			const results = [
				4.465956211090088,
				2.1849000453948975,
				0.6463223695755005,
				1.0203194618225098,
				1.5545240640640259,
				1.2625080347061157,
				1.9324926137924194,
				2.1156301498413086,
				1.4328465461730957,
				1.1107745170593262
			];
			for (let i = 0; i < results.length; i++) {
				expect(nodalVolumes[i]).to.equal(results[i]);
			}

			expect(elementVolumes.reduce((partialSum, a) => partialSum + a, 0)).to.almost.equal(nodalVolumes.reduce((partialSum, a) => partialSum + a, 0));

			// // Should only work for tet meshes.
			// // @ts-ignore
			// assert.throws(() => { MSHParser.calculateNodalVolumes({}); },
			// 		'MSHParser.calculateNodalVolumes() is not defined for non-tet meshes.');
		});
		it('calculates bounding box', () => {
			{
				const { boundingBox } = parseMsh(stanfordBunny);
				const { min, max } = boundingBox;
				expect(min).to.deep.equal([-43.133523557360256, -33.408036848762215, -0.0010786724840932279]);
				expect(max).to.deep.equal([43.138475101021584, 33.3942439679999, 83.69444330381762]);
			}
			{
				const { boundingBox } = parseMsh(wingnut);
				const { min, max } = boundingBox;
				expect(min).to.deep.equal([-1.2498986197785313, -0.5488943641668116, -4.5772923088512436e-8]);
				expect(max).to.deep.equal([1.2498814910148646, 0.5488943641071283, 1.2499371421138041]);
			}
		});
		it('scales the node positions to unit bounding box', () => {
			{
				const { boundingBox } = parseMsh(stanfordBunny).scaleNodesToUnitBoundingBox();
				const { min, max } = boundingBox;
				expect(min).to.deep.equal([-0.5, -0.3871608508879252, -0.485067711875539]);
				expect(max).to.deep.equal([0.5, 0.3871608508879252, 0.4850677118755391]);
			}
			{
				const { boundingBox } = parseMsh(wingnut).scaleNodesToUnitBoundingBox();
				const { min, max } = boundingBox;
				expect(min).to.deep.equal([-0.5, -0.21957705870487879, -0.25000942732719283]);
				expect(max).to.deep.equal([0.5, 0.21957705870487879, 0.25000942732719283]);
			}
		});
		it('throws errors for invalid setters', () => {
			const msh = parseMsh(stanfordBunny);
			// @ts-ignore
			expect(() => {msh.nodes = new Float32Array(10)}).to.throw(Error, 'msh-parser: No nodes setter.');
			// @ts-ignore
			expect(() => {msh.edges = new Uint32Array(10)}).to.throw(Error, 'msh-parser: No edges setter.');
			// @ts-ignore
			expect(() => {msh.exteriorEdges = new Uint32Array(10)}).to.throw(Error, 'msh-parser: No exteriorEdges setter.');
			// @ts-ignore
			expect(() => {msh.exteriorFaces = [0, 0, 0, 0, 0, 0, 0, 0, 0]}).to.throw(Error, 'msh-parser: No exteriorFaces setter.');
			// @ts-ignore
			expect(() => {msh.elementVolumes = new Float32Array(10)}).to.throw(Error, 'msh-parser: No elementVolumes setter.');
			// @ts-ignore
			expect(() => {msh.nodalVolumes = new Float32Array(10)}).to.throw(Error, 'msh-parser: No nodalVolumes setter.');
			// @ts-ignore
			expect(() => {msh.numExteriorNodes = 20}).to.throw(Error, 'msh-parser: No numExteriorNodes setter.');
			// @ts-ignore
			expect(() => {msh.boundingBox = { min: [0, 0, 0], max: [24, 24, 24] }}).to.throw(Error, 'msh-parser: No boundingBox setter.');

		});
	});
});

/**
 * Synchronously parse an already loaded .msh file buffer.
 */
export function parseMsh(data: Buffer | ArrayBuffer): MSHMesh {
	return new _MSHMesh(data);
}
/**
 * Load and parse .msh asynchronously from the specified url or File object (returns Promise).
 */
export function loadMshAsync(urlOrFile: string | File) {
	return new Promise<MSHMesh>((resolve) => {
		loadMsh(urlOrFile, (mesh) => {
			resolve(mesh);
		});
	});
}

/**
 * Load and parse .msh from the specified url or File object.
 */
export function loadMsh(urlOrFile: string | File, callback: (mesh: MSHMesh) => void) {
	if (typeof urlOrFile === 'string') {
		// Made this compatible with Node and the browser, maybe there is a better way?
		/* c8 ignore start */
		if (typeof window !== 'undefined') {

			// Load the file with XMLHttpRequest.
			const request = new XMLHttpRequest();
			request.open('GET', urlOrFile, true);
			request.responseType = 'arraybuffer';
			request.onload = () => {
				const mesh = parseMsh(request.response as ArrayBuffer);
				// Call the callback function with the parsed mesh data.
				callback(mesh);
			};
			request.send();
		/* c8 ignore stop */
		} else {
			// Call the callback function with the parsed mesh data.
			import('fs').then((fs) => {
				const buffer = fs.readFileSync(urlOrFile);
				callback(parseMsh(buffer));
			});
		}
	/* c8 ignore start */
	} else {
		// We only ever hit this in the browser.
		// Load the file with FileReader.
		const reader = new FileReader();
		reader.onload = () => {
			const mesh = parseMsh(reader.result as ArrayBuffer);
			// Call the callback function with the parsed mesh data.
			callback(mesh);
		}
		reader.readAsArrayBuffer(urlOrFile);
	}
	/* c8 ignore stop */
}

// Export just the type, keep the class private.
export type MSHMesh = {
	readonly nodes: Float64Array | Float32Array;
	readonly elements: number[][];
	readonly edges: Uint32Array;
	readonly exteriorEdges: Uint32Array;
	readonly exteriorFaces: number[][];
	readonly elementVolumes: Float32Array;
	readonly nodalVolumes: Float32Array;
	readonly isTetMesh: boolean;
	readonly numExteriorNodes: number;
	readonly boundingBox: { min: number[], max: number[] };
	scaleNodesToUnitBoundingBox: () => MSHMesh;
}

// Based on: https://github.com/PyMesh/PyMesh/blob/main/src/IO/MshLoader.cpp
// Define the MSHMesh class.
class _MSHMesh {
	// TextDecoder instance to decode the header as UTF-8.
	static decoder = new TextDecoder();
	// Header offset.
	private _offset = 0;

	private _nodes: Float64Array | Float32Array;
	readonly elements: number[][];
	private _edges?: Uint32Array;
	private _exteriorEdges?: Uint32Array;
	private _elementVolumes?: Float32Array;
	private _nodalVolumes?: Float32Array;
	private _boundingBox?: { min: number[], max: number[] };
	readonly isTetMesh: boolean;
	private readonly _exteriorFaces?: number[][];
	private readonly _numExteriorNodes?: number;

	constructor(data: ArrayBuffer | Buffer) {
		const arrayBuffer = (data as Buffer).buffer ? new Uint8Array(data as Buffer).buffer : data;
		const dataView = new DataView(arrayBuffer);
		// Create a Uint8Array that references the same underlying memory as the DataView.
		const uint8Array = new Uint8Array(dataView.buffer);

		// Parse header.
		/* c8 ignore next */
		if (this._parseNextLineAsUTF8(uint8Array) !== '$MeshFormat') _MSHMesh._throwInvalidFormatError();
		const [ version, type, dataSize ] = this._parseNextLineAsUTF8(uint8Array).split(' ').map(el => parseFloat(el));
		/* c8 ignore next */
		if (isNaN(version) || isNaN(type) || isNaN(dataSize)) _MSHMesh._throwInvalidFormatError();
		/* c8 ignore next */
		if (dataSize !== 8 && dataSize !== 4) throw new Error(`msh-parser: This library currently parses .msh files with data size === 8 or 4.  Current file has data size = ${dataSize}. Please submit an issue to the GitHub repo if you encounter this error and attach a sample file.`);
		const doublePrecision = dataSize === 8;
		const isBinary = type === 1;
		let isLE = false;
		if (isBinary) {
			// Read in extra info from binary header.
			// TODO: how do we know to read as LE here?
			if (dataView.getInt32(this._offset, true) === 1) {
				// Read as LE.
				isLE = true;
			}
			this._offset += 4;
		}
		/* c8 ignore next */
		if (this._parseNextLineAsUTF8(uint8Array) !== '$EndMeshFormat') _MSHMesh._throwInvalidFormatError();

		// Read the number of nodes.
		/* c8 ignore next */
		if (this._parseNextLineAsUTF8(uint8Array) !== '$Nodes') _MSHMesh._throwInvalidFormatError();
		const numNodes = parseInt(this._parseNextLineAsUTF8(uint8Array));
		// Loop through the nodes.
		const nodesArray = doublePrecision ? new Float64Array(3 * numNodes) : new Float32Array(3 * numNodes);
		if (isBinary) {
			for (let i = 0; i < numNodes; i++) {
				// Read the current node.
				const index = dataView.getInt32(this._offset, isLE) - 1; // The .msh node index is 1-indexed.
				if (doublePrecision) {
					nodesArray[3 * index] = dataView.getFloat64(this._offset + 4, isLE);
					nodesArray[3 * index + 1] = dataView.getFloat64(this._offset + 4 + dataSize, isLE);
					nodesArray[3 * index + 2] = dataView.getFloat64(this._offset + 4 + 2 * dataSize, isLE);
				} else {
					nodesArray[3 * index] = dataView.getFloat32(this._offset + 4, isLE);
					nodesArray[3 * index + 1] = dataView.getFloat32(this._offset + 4 + dataSize, isLE);
					nodesArray[3 * index + 2] = dataView.getFloat32(this._offset + 4 + 2 * dataSize, isLE);
				}
				// Update the current file's byte offset.
				this._offset += 4 + 3 * dataSize;
			}
		/* c8 ignore next 3 */
		} else {
			throw new Error('msh-parser: This library does not currently parse non-binary .msh files.  Please submit an issue to the GitHub repo if you encounter this error and attach a sample file.');
		}
		// Check that all nodes are finite.
		for (let i = 0; i < nodesArray.length; i++) {
			/* c8 ignore next */
			if (!_MSHMesh._isFiniteNumber(nodesArray[i])) throw new Error('msh-parser: NaN or Inf detected in input file.');
		}
		/* c8 ignore next */
		if (this._parseNextLineAsUTF8(uint8Array) !== '$EndNodes') _MSHMesh._throwInvalidFormatError();
		this._nodes = nodesArray;

		/* c8 ignore next */
		if (this._parseNextLineAsUTF8(uint8Array) !== '$Elements') _MSHMesh._throwInvalidFormatError();

		// Read the number of elements.
		const numElements = parseInt(this._parseNextLineAsUTF8(uint8Array));
		const elementsArray: number[][] = [];
		for (let i = 0; i < numElements; i++) {
			elementsArray.push([]);
		}
		this.elements = elementsArray;

		// Check if all elements are tetrahedra.
		let isTetMesh = true;
		// Loop through the elements.
		let elementIndex = 0;
		let tagWarning = false;
		if (isBinary) {
			while (elementIndex < numElements) {
				// Parse element header.
				const elementType = dataView.getInt32(this._offset, isLE);
				const elementNumElements = dataView.getInt32(this._offset + 4, isLE);
				const elementNumTags = dataView.getInt32(this._offset + 8, isLE);
				/* c8 ignore next */
				if (elementType !== 4) isTetMesh = false;
				const numElementNodes = _MSHMesh._numNodesPerElementType(elementType);
				// Update the current file's byte offset.
				this._offset += 12;
				for (let i = 0; i < elementNumElements; i++) {
					const index = dataView.getInt32(this._offset, isLE) - 1; // The .msh index is 1-indexed.
					/* c8 ignore next */
					if (index < 0 || index >= numElements) throw new Error(`msh-parser: Invalid element index ${index} for numElements === ${numElements}.`);
					this._offset += 4;
					/* c8 ignore start */
					for (let j = 0; j < elementNumTags; j++) {
						// const tag = dataView.getInt32(this._offset, isLE);
						if (!tagWarning) {
							tagWarning = true;
							console.warn('msh-parser: This library does not currently parse element tags.');
						}
						// Update the current file's byte offset.
						this._offset += 4;
					}
					/* c8 ignore stop */

					const nodeIndices = elementsArray[index];
					for (let j = 0; j < numElementNodes; j++) {
						const nodeIndex = dataView.getInt32(this._offset, isLE) - 1; // The .msh index is 1-indexed.
						/* c8 ignore next */
						if (!_MSHMesh._isFiniteNumber(nodeIndex)) throw new Error('msh-parser: NaN or Inf detected in input file.');
						/* c8 ignore next */
						if (nodeIndex < 0 || nodeIndex >= numNodes) throw new Error(`msh-parser: Invalid node index ${nodeIndex} for numNodes === ${numNodes}.`);
						nodeIndices.push(nodeIndex);
						// Update the current file's byte offset.
						this._offset += 4;
					}
				}

				elementIndex += elementNumElements;
			}
		/* c8 ignore next 3 */
		} else {
			throw new Error('msh-parser: This library does not currently parse non-binary .msh files.  Please submit an issue to the GitHub repo if you encounter this error and attach a sample file.');
		}
		/* c8 ignore next */
		if (this._parseNextLineAsUTF8(uint8Array) !== '$EndElements') _MSHMesh._throwInvalidFormatError();

		this.isTetMesh = isTetMesh;
		// TODO: make this work for non-tet.
		if (isTetMesh) {
			// For tet meshes, calculate exterior faces.
			// First find all faces that are covered only once, these are on the boundary.
			const hash: { [key: string]: number[] } = {};
			for (let i = 0; i < numElements; i++) {
				const indices = elementsArray[i];
				for (let j = 0; j < indices.length; j++) {
					const key = _MSHMesh._makeTriHash(indices[j], indices[(j + 1) % 4], indices[(j + 2) % 4]);
					if (hash[key]) {
						hash[key].push(indices[(j + 3) % indices.length]);
						/* c8 ignore next 3 */
						if (hash[key].length > 2) {
							throw new Error(`msh-parser: Hit face ${key} more than twice.`);
						}
					} else {
						hash[key] = [indices[(j + 3) % 4]];
					}
				}
			}
			const keys = Object.keys(hash);
			const exteriorFacesArray: number[][] = [];
			const exteriorNodes = new Uint8Array(numNodes);
			for (let i = 0, numKeys = keys.length; i < numKeys; i++) {
				const key = keys[i];
				if (hash[key].length !== 1) continue;
				const indices = keys[i].split(',');
				const a = parseInt(indices[0]);
				const b = parseInt(indices[1]);
				const c = parseInt(indices[2]);
				// d is the internal node of this tet.
				const d = hash[key][0];
				// Use d to calculate the winding order of the triangle.
				const orientation = _MSHMesh._dotProduct(_MSHMesh._crossProduct(
					_MSHMesh._vecFromTo(a, b, nodesArray),
					_MSHMesh._vecFromTo(a, c, nodesArray),
				), _MSHMesh._vecFromTo(a, d, nodesArray));
				exteriorFacesArray.push(orientation < 0 ? [a, b, c] : [a, c, b]);
				// Mark all nodes as exterior.
				exteriorNodes[a] = 1;
				exteriorNodes[b] = 1;
				exteriorNodes[c] = 1;
			}

			// Also reorder the nodes so that the exterior nodes are first.
			let currentIndex = 0;
			const newIndices = new Int32Array(numNodes);
			for (let i = 0; i < numNodes; i++) {
				if (exteriorNodes[i]) {
					newIndices[i] = currentIndex;
					currentIndex++;
				}
			}
			this._numExteriorNodes = currentIndex;
			for (let i = 0; i < numNodes; i++) {
				if (!exteriorNodes[i]) {
					newIndices[i] = currentIndex;
					currentIndex++;
				}
			}
			// Now that we have a mapping, update nodesArrays, elementsArray, and exteriorFacesArray.
			const newNodesArray = nodesArray.slice();
			for (let i = 0; i < numNodes; i++) {
				for (let j = 0; j < 3; j++) {
					newNodesArray[3 * newIndices[i] + j] = nodesArray[3 * i + j];
				}
			}
			this._nodes = newNodesArray;
			for (let i = 0; i < numElements; i++) {
				const indices = elementsArray[i];
				for (let j = 0; j < indices.length; j++) {
					indices[j] = newIndices[indices[j]];
				}
			}
			for (let i = 0; i < exteriorFacesArray.length; i++) {
				const indices = exteriorFacesArray[i];
				for (let j = 0; j < indices.length; j++) {
					indices[j] = newIndices[indices[j]];
				}
			}
			this._exteriorFaces = exteriorFacesArray;
		}
	}

	get nodes() {
		return this._nodes;
	}

	set nodes(nodes: Float32Array | Float64Array) {
		throw new Error(`msh-parser: No nodes setter.`);
	}

	private _parseNextLineAsUTF8(uint8Array: Uint8Array) {
		// Find the first newline character in the uint8Array.
		const newlineIndex = uint8Array.indexOf(10, this._offset); // 10 is the ASCII code for the newline character.
		// Decode the uint8Array as a UTF-8 encoded string up until the newline character.
		const text = _MSHMesh.decoder.decode(uint8Array.subarray(this._offset, newlineIndex));
		// Update offset.
		this._offset = newlineIndex + 1;
		// Return the decoded string.
		return text;
	}

	/* c8 ignore next 3 */
	private static _throwInvalidFormatError() {
		throw new Error('msh-parser: Invalid .msh file format.');
	}

	private static _isFiniteNumber(number: number) {
		return !isNaN(number) && number !== Infinity && number !== -Infinity;
	}

	private static _numNodesPerElementType(elementType: number) {
		switch (elementType) {
			case 2:
				return 3; // Triangle
			case 3:
				return 4; // Quad
			case 4:
				return 4; // Tetrahedron
			case 5:
				return 8; // Hexahedron
			/* c8 ignore next 2 */
			default:
				throw new Error(`msh-parser: Element type ${elementType} is not supported yet.`);
		}
	}

	// Calculates the dot product of two vectors.
	private static _dotProduct(vector1: number[], vector2: number[]) {
		return vector1[0] * vector2[0] + vector1[1] * vector2[1] + vector1[2] * vector2[2];
	}

	// Calculates the cross product of two vectors.
	private static _crossProduct(vector1: number[], vector2: number[]) {
		return [
			vector1[1] * vector2[2] - vector1[2] * vector2[1],
			vector1[2] * vector2[0] - vector1[0] * vector2[2],
			vector1[0] * vector2[1] - vector1[1] * vector2[0]
		];
	}

	private static _vecFromTo(from: number, to: number, nodesArray: Float32Array | Float64Array) {
		return [
			nodesArray[3 * to] - nodesArray[3 * from],
			nodesArray[3 * to + 1] - nodesArray[3 * from + 1],
			nodesArray[3 * to + 2] - nodesArray[3 * from + 2],
		];
	}

	private static _makeTriHash(a: number, b: number, c: number) {
		// Find the minimum and maximum of the input numbers.
		const min = Math.min(a, b, c);
		const max = Math.max(a, b, c);

		// Find the remaining number.
		const remaining = a + b + c - min - max;

		// Join the numbers in ascending order into a string with commas.
		return`${min},${remaining},${max}`;
	}

	get edges() {
		if (!this._edges) {
			const { elements, isTetMesh } = this;
			/* c8 ignore next */
			if (!isTetMesh) throw new Error(`msh-parser: MSHMesh.edges is not defined for non-tet meshes.`);
			// Calc all edges in mesh, use hash table to cover each edge only once.
			const hash: { [key: string]: boolean } = {};
			for (let i = 0, numElements = elements.length; i < numElements; i++) {
				const elementIndices = elements[i];
				// For tetrahedra, create an edge between each pair of nodes in element.
				const numNodes = elementIndices.length;
				for (let j = 0; j < numNodes; j++) {
					for (let k = j + 1; k < numNodes; k++) {
						const a = elementIndices[j];
						const b = elementIndices[k];
						const key = `${Math.min(a, b)},${Math.max(a, b)}`;
						hash[key] = true;
					}
				}
			}
			const keys = Object.keys(hash);
			const edgesArray = new Uint32Array(keys.length * 2);
			for (let i = 0, length = keys.length; i < length; i++) {
				const indices = keys[i].split(',');
				edgesArray[2 * i] = parseInt(indices[0]);
				edgesArray[2 * i + 1] = parseInt(indices[1]);
			}
			this._edges = edgesArray;
		}
		return this._edges;
	}

	set edges(edges: Uint32Array) {
		throw new Error(`msh-parser: No edges setter.`);
	}

	get exteriorEdges() {
		if (!this._exteriorEdges) {
			const { isTetMesh, _exteriorFaces } = this; 
			/* c8 ignore next */
			if (!isTetMesh) throw new Error(`msh-parser: MSHMesh.exteriorEdges is not defined for non-tet meshes.`);
			// Calc all exterior edges in mesh, use hash table to cover each edge only once.
			const hash: { [key: string]: boolean } = {};
			for (let i = 0, numFaces = _exteriorFaces!.length; i < numFaces; i++) {
				const faceIndices = _exteriorFaces![i];
				// For triangles, create an edge between each pair of indices in face.
				const numNodes = faceIndices.length;
				for (let j = 0; j < numNodes; j++) {
					for (let k = j + 1; k < numNodes; k++) {
						const a = faceIndices[j];
						const b = faceIndices[k];
						const key = `${Math.min(a, b)},${Math.max(a, b)}`;
						hash[key] = true;
					}
				}
			}
			const keys = Object.keys(hash);
			const edgesArray = new Uint32Array(keys.length * 2);
			for (let i = 0, length = keys.length; i < length; i++) {
				const indices = keys[i].split(',');
				edgesArray[2 * i] = parseInt(indices[0]);
				edgesArray[2 * i + 1] = parseInt(indices[1]);
			}
			this._exteriorEdges = edgesArray;
		}
		return this._exteriorEdges;
	}

	set exteriorEdges(exteriorEdges: Uint32Array) {
		throw new Error(`msh-parser: No exteriorEdges setter.`);
	}

	get exteriorFaces() {
		/* c8 ignore next */
		if (!this.isTetMesh || !this._exteriorFaces) throw new Error(`msh-parser: MSHMesh.exteriorFaces is not defined for non-tet meshes.`);
		return this._exteriorFaces;
	}

	set exteriorFaces(exteriorFaces: number[][]) {
		throw new Error(`msh-parser: No exteriorFaces setter.`);
	}

	private static _tetrahedronVolume(indices: number[], nodesArray: Float32Array | Float64Array) {
		const [a, b, c, d] = indices;
		// Calculate the vectors representing the edges of the tetrahedron.
		const v1 = _MSHMesh._vecFromTo(d, a, nodesArray);
		const v2 = _MSHMesh._vecFromTo(d, b, nodesArray);
		const v3 = _MSHMesh._vecFromTo(d, c, nodesArray);

		// Calculate the volume of the tetrahedron using the formula:""
		// (1/6) * |v1 . (v2 x v3)|
		// https://en.wikipedia.org/wiki/Tetrahedron#Volume
		return Math.abs(_MSHMesh._dotProduct(v1, _MSHMesh._crossProduct(v2, v3))) / 6;
	}

	get elementVolumes() {
		if (!this._elementVolumes) {
			const { elements, nodes, isTetMesh } = this;
			/* c8 ignore next */
			if (!isTetMesh) throw new Error(`msh-parser: MSHMesh.elementVolumes is not defined for non-tet meshes.`);
			const numElements = elements.length;
			const volumes = new Float32Array(numElements);
			for (let i = 0; i < numElements; i++) {
				volumes[i] = _MSHMesh._tetrahedronVolume(elements[i], nodes);
			}
			this._elementVolumes = volumes;
		}
		return this._elementVolumes;
	}

	set elementVolumes(elementVolumes: Float32Array) {
		throw new Error(`msh-parser: No elementVolumes setter.`);
	}

	get nodalVolumes() {
		if (!this._nodalVolumes) {
			const { elements, nodes, isTetMesh } = this;
			/* c8 ignore next */
			if (!isTetMesh) throw new Error(`msh-parser: MSHMesh.nodalVolumes is not defined for non-tet meshes.`);
			const { elementVolumes } = this;
			const nodalVolumes = new Float32Array(nodes.length / 3);
			for (let i = 0, numElements = elements.length; i < numElements; i++) {
				const nodeIndices = elements[i];
				const numNodeIndices = nodeIndices.length;
				for (let j = 0; j < numNodeIndices; j++) {
					const nodeIndex = nodeIndices[j];
					// Split element volume evenly across adjacent nodes.
					nodalVolumes[nodeIndex] += elementVolumes[i] / numNodeIndices;
				}
			}
			this._nodalVolumes = nodalVolumes;
		}
		return this._nodalVolumes;
	}

	set nodalVolumes(nodalVolumes: Float32Array) {
		throw new Error(`msh-parser: No nodalVolumes setter.`);
	}

	get numExteriorNodes() {
		/* c8 ignore next */
		if (!this.isTetMesh || !this._numExteriorNodes) throw new Error(`msh-parser: MSHMesh.numExteriorNodes is not defined for non-tet meshes.`);
		return this._numExteriorNodes;
	}

	set numExteriorNodes(numExteriorNodes: number) {
		throw new Error(`msh-parser: No numExteriorNodes setter.`);
	}

	get boundingBox() {
		if (!this._boundingBox) {
			const { nodes } = this;
			const numNodes = nodes.length / 3;
			const min = [Infinity, Infinity, Infinity];
			const max = [-Infinity, -Infinity, -Infinity];
			for (let i = 0; i < numNodes; i++) {
				min[0] = Math.min(min[0], nodes[3 * i]);
				min[1] = Math.min(min[1], nodes[3 * i + 1]);
				min[2] = Math.min(min[2], nodes[3 * i + 2]);
				max[0] = Math.max(max[0], nodes[3 * i]);
				max[1] = Math.max(max[1], nodes[3 * i + 1]);
				max[2] = Math.max(max[2], nodes[3 * i + 2]);
			}
			this._boundingBox = {
				min, max,
			};
		}
		return this._boundingBox;
	}

	set boundingBox(boundingBox: { min: number[], max: number[] }) {
		throw new Error(`msh-parser: No boundingBox setter.`);
	}

	/**
	 * Scales nodes to unit bounding box and centers around origin.
	 */
	scaleNodesToUnitBoundingBox() {
		const { nodes, boundingBox } = this;
		const { min, max } = boundingBox;
		const diff = [max[0] - min[0], max[1] - min[1], max[2] - min[2]];
		const center = [(max[0] + min[0]) / 2, (max[1] + min[1]) / 2, (max[2] + min[2]) / 2];
		const scale = Math.max(diff[0], diff[1], diff[2]);
		const numNodes = nodes.length / 3;
		for (let i = 0; i < numNodes; i++) {
			for (let j = 0; j < 3; j++) {
				// Uniform scale.
				nodes[3 * i + j] = (nodes[3 * i + j] - center[j]) / scale;
			}
		}
		delete this._boundingBox;
		delete this._nodalVolumes;
		delete this._elementVolumes;
		return this;
	}
}

import { register, RegisterOptions, Service } from './index';
import {
  parse as parseUrl,
  format as formatUrl,
  UrlWithStringQuery,
  fileURLToPath,
  pathToFileURL,
} from 'url';
import { extname } from 'path';
import * as assert from 'assert';
import { normalizeSlashes, versionGteLt } from './util';
import { createRequire } from 'module';

// Note: On Windows, URLs look like this: file:///D:/dev/@TypeStrong/ts-node-examples/foo.ts

// NOTE ABOUT MULTIPLE EXPERIMENTAL LOADER APIS
//
// At the time of writing, this file implements 2x different loader APIs.
// Node made a breaking change to the loader API in https://github.com/nodejs/node/pull/37468
//
// We check the node version number and export either the *old* or the *new* API.
//
// Today, we are implementing the *new* API on top of our implementation of the *old* API,
// which relies on copy-pasted code from the *old* hooks implementation in node.
//
// In the future, we will likely invert this: we will copy-paste the *new* API implementation
// from node, build our implementation of the *new* API on top of it, and implement the *old*
// hooks API as a shim to the *new* API.

export interface NodeLoaderHooksAPI1 {
  resolve: NodeLoaderHooksAPI1.ResolveHook;
  getFormat: NodeLoaderHooksAPI1.GetFormatHook;
  transformSource: NodeLoaderHooksAPI1.TransformSourceHook;
}
export namespace NodeLoaderHooksAPI1 {
  export type ResolveHook = NodeLoaderHooksAPI2.ResolveHook;
  export type GetFormatHook = (
    url: string,
    context: {},
    defaultGetFormat: GetFormatHook
  ) => Promise<{ format: NodeLoaderHooksFormat }>;
  export type TransformSourceHook = (
    source: string | Buffer,
    context: { url: string; format: NodeLoaderHooksFormat },
    defaultTransformSource: NodeLoaderHooksAPI1.TransformSourceHook
  ) => Promise<{ source: string | Buffer }>;
}

export interface NodeLoaderHooksAPI2 {
  resolve: NodeLoaderHooksAPI2.ResolveHook;
  load: NodeLoaderHooksAPI2.LoadHook;
}
export namespace NodeLoaderHooksAPI2 {
  export type ResolveHook = (
    specifier: string,
    context: {
      conditions?: NodeImportConditions;
      importAssertions?: NodeImportAssertions;
      parentURL: string;
    },
    defaultResolve: ResolveHook
  ) => Promise<{
    url: string;
    format?: NodeLoaderHooksFormat;
    shortCircuit?: boolean;
  }>;
  export type LoadHook = (
    url: string,
    context: {
      format: NodeLoaderHooksFormat | null | undefined;
      importAssertions?: NodeImportAssertions;
    },
    defaultLoad: NodeLoaderHooksAPI2['load']
  ) => Promise<{
    format: NodeLoaderHooksFormat;
    source: string | Buffer | undefined;
    shortCircuit?: boolean;
  }>;
  export type NodeImportConditions = unknown;
  export interface NodeImportAssertions {
    type?: 'json';
  }
}

export type NodeLoaderHooksFormat =
  | 'builtin'
  | 'commonjs'
  | 'dynamic'
  | 'json'
  | 'module'
  | 'wasm';

export type NodeImportConditions = unknown;
export interface NodeImportAssertions {
  type?: 'json';
}

// The hooks API changed in node version X so we need to check for backwards compatibility.
const newHooksAPI = versionGteLt(process.versions.node, '16.12.0');

/** @internal */
export function filterHooksByAPIVersion(
  hooks: NodeLoaderHooksAPI1 & NodeLoaderHooksAPI2
): NodeLoaderHooksAPI1 | NodeLoaderHooksAPI2 {
  const { getFormat, load, resolve, transformSource } = hooks;
  // Explicit return type to avoid TS's non-ideal inferred type
  const hooksAPI: NodeLoaderHooksAPI1 | NodeLoaderHooksAPI2 = newHooksAPI
    ? { resolve, load, getFormat: undefined, transformSource: undefined }
    : { resolve, getFormat, transformSource, load: undefined };
  return hooksAPI;
}

/** @internal */
export function registerAndCreateEsmHooks(opts?: RegisterOptions) {
  // Automatically performs registration just like `-r ts-node/register`
  const tsNodeInstance = register(opts);

  return createEsmHooks(tsNodeInstance);
}

export function createEsmHooks(tsNodeService: Service) {
  tsNodeService.enableExperimentalEsmLoaderInterop();

  // Custom implementation that considers additional file extensions and automatically adds file extensions
  const nodeResolveImplementation = tsNodeService.getNodeEsmResolver();
  const nodeGetFormatImplementation = tsNodeService.getNodeEsmGetFormat();
  const extensions = tsNodeService.extensions;

  const hooksAPI = filterHooksByAPIVersion({
    resolve,
    load,
    getFormat,
    transformSource,
  });

  function isFileUrlOrNodeStyleSpecifier(parsed: UrlWithStringQuery) {
    // We only understand file:// URLs, but in node, the specifier can be a node-style `./foo` or `foo`
    const { protocol } = parsed;
    return protocol === null || protocol === 'file:';
  }

  /**
   * Named "probably" as a reminder that this is a guess.
   * node does not explicitly tell us if we're resolving the entrypoint or not.
   */
  function isProbablyEntrypoint(specifier: string, parentURL: string) {
    return parentURL === undefined && specifier.startsWith('file://');
  }
  // Side-channel between `resolve()` and `load()` hooks
  const rememberIsProbablyEntrypoint = new Set();
  const rememberResolvedViaCommonjsFallback = new Set();

  async function resolve(
    specifier: string,
    context: { parentURL: string },
    defaultResolve: typeof resolve
  ): Promise<{ url: string; format?: NodeLoaderHooksFormat }> {
    const defer = async () => {
      const r = await defaultResolve(specifier, context, defaultResolve);
      return r;
    };
    // See: https://github.com/nodejs/node/discussions/41711
    // nodejs will likely implement a similar fallback.  Till then, we can do our users a favor and fallback today.
    async function entrypointFallback(
      cb: () => ReturnType<typeof resolve> | Awaited<ReturnType<typeof resolve>>
    ): ReturnType<typeof resolve> {
      try {
        const resolution = await cb();
        if (
          resolution?.url &&
          isProbablyEntrypoint(specifier, context.parentURL)
        )
          rememberIsProbablyEntrypoint.add(resolution.url);
        return resolution;
      } catch (esmResolverError) {
        if (!isProbablyEntrypoint(specifier, context.parentURL))
          throw esmResolverError;
        try {
          let cjsSpecifier = specifier;
          // Attempt to convert from ESM file:// to CommonJS path
          try {
            if (specifier.startsWith('file://'))
              cjsSpecifier = fileURLToPath(specifier);
          } catch {}
          const resolution = pathToFileURL(
            createRequire(process.cwd()).resolve(cjsSpecifier)
          ).toString();
          rememberIsProbablyEntrypoint.add(resolution);
          rememberResolvedViaCommonjsFallback.add(resolution);
          return { url: resolution, format: 'commonjs' };
        } catch (commonjsResolverError) {
          throw esmResolverError;
        }
      }
    }

    return addShortCircuitFlag(async () => {
      const parsed = parseUrl(specifier);
      const { pathname, protocol, hostname } = parsed;

      if (!isFileUrlOrNodeStyleSpecifier(parsed)) {
        return entrypointFallback(defer);
      }

      if (protocol !== null && protocol !== 'file:') {
        return entrypointFallback(defer);
      }

      // Malformed file:// URL?  We should always see `null` or `''`
      if (hostname) {
        // TODO file://./foo sets `hostname` to `'.'`.  Perhaps we should special-case this.
        return entrypointFallback(defer);
      }

      // pathname is the path to be resolved

      return entrypointFallback(() =>
        nodeResolveImplementation.defaultResolve(
          specifier,
          context,
          defaultResolve
        )
      );
    });
  }

  // `load` from new loader hook API (See description at the top of this file)
  async function load(
    url: string,
    context: {
      format: NodeLoaderHooksFormat | null | undefined;
      importAssertions?: NodeLoaderHooksAPI2.NodeImportAssertions;
    },
    defaultLoad: typeof load
  ): Promise<{
    format: NodeLoaderHooksFormat;
    source: string | Buffer | undefined;
  }> {
    return addShortCircuitFlag(async () => {
      // If we get a format hint from resolve() on the context then use it
      // otherwise call the old getFormat() hook using node's old built-in defaultGetFormat() that ships with ts-node
      const format =
        context.format ??
        (
          await getFormat(
            url,
            context,
            nodeGetFormatImplementation.defaultGetFormat
          )
        ).format;

      let source = undefined;
      if (format !== 'builtin' && format !== 'commonjs') {
        // Call the new defaultLoad() to get the source
        const { source: rawSource } = await defaultLoad(
          url,
          {
            ...context,
            format,
          },
          defaultLoad
        );

        if (rawSource === undefined || rawSource === null) {
          throw new Error(
            `Failed to load raw source: Format was '${format}' and url was '${url}''.`
          );
        }

        // Emulate node's built-in old defaultTransformSource() so we can re-use the old transformSource() hook
        const defaultTransformSource: typeof transformSource = async (
          source,
          _context,
          _defaultTransformSource
        ) => ({ source });

        // Call the old hook
        const { source: transformedSource } = await transformSource(
          rawSource,
          { url, format },
          defaultTransformSource
        );
        source = transformedSource;
      }

      return { format, source };
    });
  }

  async function getFormat(
    url: string,
    context: {},
    defaultGetFormat: typeof getFormat
  ): Promise<{ format: NodeLoaderHooksFormat }> {
    const defer = (overrideUrl: string = url) =>
      defaultGetFormat(overrideUrl, context, defaultGetFormat);

    // See: https://github.com/nodejs/node/discussions/41711
    // nodejs will likely implement a similar fallback.  Till then, we can do our users a favor and fallback today.
    async function entrypointFallback(
      cb: () => ReturnType<typeof getFormat>
    ): ReturnType<typeof getFormat> {
      try {
        return await cb();
      } catch (getFormatError) {
        if (!rememberIsProbablyEntrypoint.has(url)) throw getFormatError;
        return { format: 'commonjs' };
      }
    }

    const parsed = parseUrl(url);

    if (!isFileUrlOrNodeStyleSpecifier(parsed)) {
      return entrypointFallback(defer);
    }

    const { pathname } = parsed;
    assert(
      pathname !== null,
      'ESM getFormat() hook: URL should never have null pathname'
    );

    const nativePath = fileURLToPath(url);

    let nodeSays: { format: NodeLoaderHooksFormat };

    // If file has extension not understood by node, then ask node how it would treat the emitted extension.
    // E.g. .mts compiles to .mjs, so ask node how to classify an .mjs file.
    const ext = extname(nativePath);
    const tsNodeIgnored = tsNodeService.ignored(nativePath);
    const nodeEquivalentExt = extensions.nodeEquivalents.get(ext);
    if (nodeEquivalentExt && !tsNodeIgnored) {
      nodeSays = await entrypointFallback(() =>
        defer(formatUrl(pathToFileURL(nativePath + nodeEquivalentExt)))
      );
    } else {
      try {
        nodeSays = await entrypointFallback(defer);
      } catch (e) {
        if (
          e instanceof Error &&
          tsNodeIgnored &&
          extensions.nodeDoesNotUnderstand.includes(ext)
        ) {
          e.message +=
            `\n\n` +
            `Hint:\n` +
            `ts-node is configured to ignore this file.\n` +
            `If you want ts-node to handle this file, consider enabling the "skipIgnore" option or adjusting your "ignore" patterns.\n` +
            `https://typestrong.org/ts-node/docs/scope\n`;
        }
        throw e;
      }
    }
    // For files compiled by ts-node that node believes are either CJS or ESM, check if we should override that classification
    if (
      !tsNodeService.ignored(nativePath) &&
      (nodeSays.format === 'commonjs' || nodeSays.format === 'module')
    ) {
      const { moduleType } =
        tsNodeService.moduleTypeClassifier.classifyModuleByModuleTypeOverrides(
          normalizeSlashes(nativePath)
        );
      if (moduleType === 'cjs') {
        return { format: 'commonjs' };
      } else if (moduleType === 'esm') {
        return { format: 'module' };
      }
    }
    return nodeSays;
  }

  async function transformSource(
    source: string | Buffer,
    context: { url: string; format: NodeLoaderHooksFormat },
    defaultTransformSource: typeof transformSource
  ): Promise<{ source: string | Buffer }> {
    if (source === null || source === undefined) {
      throw new Error('No source');
    }

    const defer = () =>
      defaultTransformSource(source, context, defaultTransformSource);

    const sourceAsString =
      typeof source === 'string' ? source : source.toString('utf8');

    const { url } = context;
    const parsed = parseUrl(url);

    if (!isFileUrlOrNodeStyleSpecifier(parsed)) {
      return defer();
    }
    const nativePath = fileURLToPath(url);

    if (tsNodeService.ignored(nativePath)) {
      return defer();
    }

    const emittedJs = tsNodeService.compile(sourceAsString, nativePath);

    return { source: emittedJs };
  }

  return hooksAPI;
}

async function addShortCircuitFlag<T>(fn: () => Promise<T>) {
